import select


def is_palindrome(s, i, j):
    while i <= j:
        if s[i] != s[j]:
            return False
        i += 1
        j -= 1
    return True


def palindrome_partition(A, i, j, dp):
    if dp[i][j] != -1:
        return dp[i][j]

    if i >= j or is_palindrome(A, i, j):
        return 0

    ans = 1e9
    for k in range(i, j):
        if dp[i][k] != -1:
            left = dp[i][k]
        else:
            dp[i][k] = left = palindrome_partition(A, i, k, dp)
        if dp[k + 1][j] != -1:
            right = dp[k + 1][j]
        else:
            dp[k + 1][j] = right = palindrome_partition(A, k + 1, j, dp)

        ans = min(ans, 1 + left + right)

    dp[i][j] = ans
    return ans


string = ""
